import{_ as t,o as n,c as r,z as e,a}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 1-222.1 Manufacturer.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/1-222.1.md","filePath":"vacode/1-222.1.md"}'),o={name:"vacode/1-222.1.md"},s=e("h1",{id:"§-1-222-1-manufacturer",tabindex:"-1"},[a("§ 1-222.1 Manufacturer. "),e("a",{class:"header-anchor",href:"#§-1-222-1-manufacturer","aria-label":'Permalink to "§ 1-222.1 Manufacturer."'},"​")],-1),i=e("p",null,'"Manufacturer" shall not include any farm or aggregation of farms that owns and operates facilities within the Commonwealth for the generation of electric energy from waste-to-energy technology. As used in this definition, (i) "farm" means any person that obtains at least 51 percent of its annual gross income from agricultural operations and produces the agricultural waste used as feedstock for the waste-to-energy technology, (ii) "agricultural waste" means biomass waste materials capable of decomposition that are produced from the raising of plants and animals during agricultural operations, including animal manures, bedding, plant stalks, hulls, and vegetable matter, and (iii) "waste-to-energy technology" means any technology, including but not limited to a methane digester, that converts agricultural waste into gas, steam, or heat that is used to generate electricity on-site.',-1),c=e("p",null,[a("2009, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0746",target:"_blank",rel:"noreferrer"},"746"),a(".")],-1),l=[s,i,c];function d(u,h,f,m,g,p){return n(),r("div",null,l)}const b=t(o,[["render",d]]);export{y as __pageData,b as default};
